import { useEffect } from "react";
import { GET_BLOGS } from "../../apis/Apis";

const BlogPanel = () => {
    useEffect(()=>{
        getBlogs()
    },[])
  const getBlogs =async () => {
    try {
      const res =await GET_BLOGS();
      console.log(res);
    } catch (error) {
      console.log(error);
    }
  };
  return <></>;
};
export default BlogPanel;
